'''Dutch Limburg''' may refer to the following: * [[Limburg (Netherlands)]] (1866–present), a province of the Netherlands * [[Duchy of Limburg (1839–1867)]], a duchy in personal union with the Kingdom of the Netherlands * [[Province of Limburg (1815–1839)]], a province of the former United Kingdom of the Netherlands * Limburg of the States, territories controlled by the Dutch States-General from 1648 to 1794 as [[Generality Lands]]
